    [],nt"title": "k194hw.m77t and k194hw.h77t: MGD77T data and header files for
    single-beam bathymetry data for field activity K-1-94-HW in Mamala Bay, Offshore
    Honolulu, Oahu, Hawaii from 05/10/1994 to 05/16/1994",nt"tracking_summary":
    {ntt"total": 3,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2013-09-11T20:09:18.176023",nt"name": "k194hw-m77t-and-k194hw-h77t-mgd77t-data-and-header-files-for-single-beam-bathymetry-dat-16-1994",nt"isopen":
    false,nt"url": null,nt"notes": "Single-beam bathymetry data along with
    DGPS navigation data was collected as part of the U.S. Geological Survey cruise
    K-1-94-HW. The cruise was conducted in Oahu, Hawaii from May 10 to May 16, 1994.
    The chief scientists were Mike Torresan and Monty Hampton from the USGS Coastal
    and Marine Geology office in Menlo Park, CA. The purpose of this cruise was to create
    a detailed bathymetric map of the Mamala Bay seafloor that delimits the general
    extent of the acoustically-resolvable dredged material deposits. The geophysical
    source was a Raytheon 12 kilohertz (kHz) DSF-6000 fathometer. These data are reformatted
    from space-delimited ASCII text files located in the Coastal and Marine Geology
    Program (CMGP) InfoBank field activity catalog at http://walrus.wr.usgs.gov/infobank/k/k194hw/html/k-1-94-hw.meta.html
    into MGD77T format provided by the NOAA's National Geophysical Data Center(NGDC).
    The MGD77T format includes a header (documentation) file (.h77t) and a data file
    (.m77t). More information regarding this format can be found in the publication
    listed in the Cross_reference section of this metadata file.",nt"license_title":
